allow-lan: true
ipv6: true
bind-address: '*'
unified-delay: true
tcp-concurrent: true
keep-alive-idle: 600
keep-alive-interval: 60
find-process-mode: strict
external-controller: '[::]:9090'
external-ui: ui
external-ui-url: 'https://github.com/Zephyruso/zashboard/releases/latest/download/dist.zip'
profile:
  store-selected: true
  store-fake-ip: true
dns:
  enable: true
  ipv6: true
  listen: ':1053'
  cache-algorithm: arc
  use-hosts: true
  use-system-hosts: true
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  fake-ip-range6: 'fc00::/18'
  fake-ip-filter:
    - 'rule-set:fakeip_filter'
  nameserver:
    - 'https://dns.alidns.com/dns-query'
  direct-nameserver:
    - system
  proxy-server-nameserver:
    - 'https://doh.pub/dns-query'
  nameserver-policy:
    '*': system
    +.arpa: system
    'rule-set:gfw': 'https://dns.google/dns-query#默认节点'
hosts:
  dns.alidns.com:
    - 223.5.5.5
    - 223.6.6.6
  doh.pub:
    - 1.12.12.21
    - 120.53.53.53
  dns.google:
    - 8.8.8.8
    - 8.8.4.4
sniffer:
  enable: true
  force-dns-mapping: true
  parse-pure-ip: true
  override-destination: false
  sniff:
    HTTP:
      ports:
        - 80
        - 8080-8880
      override-destination: true
    TLS:
      ports:
        - 443
        - 8443
    QUIC:
      ports:
        - 443
        - 8443
  skip-domain:
    - Mijia Cloud
    - +.oray.com
    - +.push.apple.com
  skip-dst-address:
    - 'rule-set:telegram_ip'
ntp:
  enable: true
  write-to-system: false
  server: cn.ntp.org.cn
tun:
  enable: true
  stack: system
  auto-route: true
  auto-redirect: true
  auto-detect-interface: true
  dns-hijack:
    - 'udp://any:53'
    - 'tcp://any:53'
